import React, { Component } from 'react'
import ReactMapboxGl, { Layer, Feature } from "react-mapbox-gl";
import { GeoJSONLayer } from "react-mapbox-gl";

const Map = ReactMapboxGl({
  accessToken: "pk.eyJ1IjoianRhbmc5MyIsImEiOiJjanB1OXIyZXQwZWZ4M3hudHM4NGl0cmc3In0.q6DGhvJla097_6b-RMi0Fw"
})

const Mapbox = props => {

let geojson

fetch('http://localhost:4000/api/v1/listings')
.then(r => r.json())
.then(parsed => {
  geojson = parsed
  console.log(geojson)
})

map.on('load', function () {

    map.addLayer({
        "id": "points",
        "type": "symbol",
        "source": {
            "type": "geojson",
            "data": {
                "type": "FeatureCollection",
                "features": [{
                    "type": "Feature",
                    "geometry": {
                        "type": "Point",
                        "coordinates": [-77.03238901390978, 38.913188059745586]
                    },
                    "properties": {
                        "title": "Mapbox DC",
                        "icon": "monument"
                    }
                }, {
                    "type": "Feature",
                    "geometry": {
                        "type": "Point",
                        "coordinates": [-122.414, 37.776]
                    },
                    "properties": {
                        "title": "Mapbox SF",
                        "icon": "harbor"
                    }
                }]
            }
        },
        "layout": {
            "icon-image": "{icon}-15",
            "text-field": "{title}",
            "text-font": ["Open Sans Semibold", "Arial Unicode MS Bold"],
            "text-offset": [0, 0.6],
            "text-anchor": "top"
        }
    });
});

return (
<div>
  <Map
  style="mapbox://styles/mapbox/streets-v9"
  center={[-74.0060, 40.7128]}
  containerStyle={{
    height: "100vh",
    width: "100vw"
  }}>
    <Layer
    type="symbol"
    id="marker"
    layout={{ "icon-image": "marker-15" }}>
    <Feature coordinates={[40.7128, 74.0060]}/>
    </Layer>

    <Layer>
    <GeoJSONLayer
    data={geojson}
    symbolLayout={{
      "text-field": "{place}",
      "text-font": ["Open Sans Semibold", "Arial Unicode MS Bold"],
      "text-offset": [0, 0.6],
      "text-anchor": "top"
    }}/>
    </Layer>
  </Map>


  </div>
)


}

export default Mapbox
